import React from 'react';

const About = () => {
  return (
    <div className="about-page">
      <h2>About Us</h2>
      <p>
        This page is part of Yeonseo Jung's side project. It's a virtual home shopping platform created using open APIs to showcase products in a dynamic, interactive way. We aim to create a seamless, realistic shopping experience.
      </p>
    </div>
  );
};

export default About;
